import Home from "./components/Home";
import Blogs from "./components/Blogs.js";

import "./styles.css";

 function App() {
  let component
  switch (window.location.pathname){
    case "/":
      component = <Home/>
      break
      case "/blogs":
        component = <Blogs/>
        break

  }
  return (
    <div className="App">
      <Navbar />
      {component}
      <Home />

    </div>
  );
}
export default App;
